package info.nukoneko.cuc.kidspos.model;import java.util.ArrayList;/** * Created by TEJNEK on 2015/10/12. */public class SendAccountObject {    final public int storeID;    final public long datetime;    public ArrayList<SendItemObject> items = new ArrayList<>();    public SendAccountObject(int storeID, long datetime){        this.storeID = storeID;        this.datetime = datetime;    }    public void add(SendItemObject itemObject){        this.items.add(itemObject);    }    public void addAll(ArrayList<SendItemObject> itemObjects){        this.items.addAll(itemObjects);    }}